            <div class="labeltitle">Last Wild Edge: One Woman''s Journey from the Arctic Circle to the Olympic Rain Forest</div>
            <div class="labelvolume"></div>
            <div class="labelsubtitle"></div>
            <div class="labelsubtitle"></div>
            <div class="labelattributes">Susan Zwinger</div>
            <div class="labeldescription"><br/>The northwestern edge of North America is a final edge to settle on a finite planet. Where does mankind go from here? Where else have we not settled, altered, and consumed ? Author Susan Zwinger suspects that we have saved this wild edge for last because its geography is punched, exploded, ground, and drenched. Its forest of enormous trees once created a boundary difficult to penetrate, let alone farm. Yet, today this wildness is under threat, as civilization bores its way into even this remote edge.</div>
