<div id="pagebackground">
    <div id="pagecontent">
        <div id="divwrap">
            <div class="labeltitle">Hiking Washington''s Mount Adams Country: A Guide to the Mount Adams, Indian Heaven, and Trapper Creek Wilderness Areas of Washington''s Southern Cascad</div>
            <div class="labelvolume"></div>
            <div class="labelsubtitle"></div>
            <div class="labelsubtitle"></div>
            <div class="labelattributes">Fred Barstad</div>
